export default (state = false, action) => {
  switch (action.type) {
    
    case 'INDEX_ITEMS':
      return action.payload.map(  (item) =>
      <>
        <span key={item.id}>
          {item.id}
          {item.nome}
          {item.desc}
          {item.preco}
        </span>
      </>
      );

    default:
      return state;
  }
}
